$mainwdith: 1280px;
$contentheight: 100%;

.demo-ruleForm {
  padding: 20px;
  .svg-icon {
    font-size: 48px;
    margin: 10px;
    position: relative;
    top: 20px;
  }
}
.el-container {
  height: $contentheight;
}
.el-header {
  background-color: #2a3648;
  .header {
    width: $mainwdith;
    height: 40px;
    margin: 0 auto;
    color: #fff;
    .logo {
      width: 40px;
      float: left;
      margin-top: 15px;
    }
    .title {
      margin: 18px 0 0 10px;
      float: left;
      font-size: 22px;
    }
  }
}

.el-main {
  height: $contentheight;
  padding: 0;
  background-color: #f5f6fa;
  padding-bottom: 20px;
  .myprojectbox {
    background-color: #fff;
    height: 70px;
    border-bottom: 1px #efeef3 solid;
    //   box-shadow: 0 2px 12px 0 rgba(0, 0, 0, 0.1);
    .myproject {
      width: $mainwdith;
      margin: 0 auto;
      line-height: 70px;
      font-size: 20px;
      .mytite {
        float: left;
      }
      .addbt {
        float: right;
        margin: 15px;
        background-color: #7db6d7;
        border: none;
      }
      .addbt:hover {
        background-color: #73abcc;
      }
    }
  }
  .contentbox {
    width: $mainwdith;
    margin: 0 auto;
    padding-bottom: 120px;
    text-align: left;
    background-color: #999;
    padding: 0;
    li {
      color: #2a3648;
      list-style: none;
      float: left;
      //   border-radius: 5px;
      background-color: #fff;
      width: $mainwdith/4-20;
      padding: 10px 30px;
      margin-right: 20px;
      margin-top: 20px;
      box-shadow: 1px 1px 1px #eee;
      height: 280px;
      position: relative;
      .coverbox {
        display: none;
        position: absolute;
        top: 0;
        left: 0;
        width: 100%;
        height: 100%;
        .buttonbox {
          width: 100%;
          height: 50px;
          position: absolute;
          bottom: 0;
        }
        .el-button {
          position: relative;
          top: -10px;
          right: 20px;
        }
      }
      h2 {
        font-size: 68px;
        margin: 5px;
      }
      span {
        font-size: 22px;
        color: #b1d8e5;
      }
      h3 {
        font-size: 18px;
      }
      p {
        font-size: 14px;
        display: block;
        color: #666;
      }
      .projectdoc {
        height: 10px;
        color: #999;
      }
      .el-button {
        float: right;
        position: relative;
        bottom: -10px;
      }
    }
    li:hover {
      position: relative;
      top: -2px;
      right: -2px;
      box-shadow: 5px 5px 10px #ddd;
      //   cursor: pointer;
    }
    li:hover .coverbox {
      display: block;
    }
  }
}
.avatar-container {
  margin-right: 30px;
  float: right;

  .avatar-wrapper {
    margin-top: 10px;
    position: relative;

    .user-avatar {
      cursor: pointer;
      width: 40px;
      height: 40px;
      border-radius: 10px;
    }

    .el-icon-caret-bottom {
      cursor: pointer;
      position: absolute;
      right: -20px;
      top: 25px;
      font-size: 12px;
    }
  }
}
body > .el-container {
  margin-bottom: 40px;
  background-color: #fdfaf3;
}
.el-footer {
  text-align: center;
  height: 60px;
  font-size: 12px;
  color: #666;
  clear: both;
  background-color: #fff;
  border-top: 1px #efeef3 solid;
  line-height: 60px;
}
